    function addRemoteButtonEvent(id, payload){
        var idObjectOn = $('#on_'+id);

        $(document).delegate(idObjectOn, 'click', function() {
            $(this).attr('src','img/remote_on.png');
            sendMessage(payload);
        });

        var idObjectOff = $('#off_'+id);
        $(document).delegate(idObjectOff, 'click', function() {
            $(this).attr('src','img/remote_off.png');
            sendMessage(payload);
        });
    }
